import React from 'react';
import { Link } from 'react-router-dom';
import { Button, Box, Typography } from '@mui/material';

interface NavbarProps {
    isLoggedIn: boolean;
  }

  const Navbar: React.FC<NavbarProps> = ({ isLoggedIn }) => {
    return (
      <Box display="flex" justifyContent="space-between" alignItems="center" p={2} bgcolor="#3f51b5" color="white">
        <Box>
          {!isLoggedIn ? (
            <>
              <Button component={Link} to="/login" variant="contained" color="secondary">
                LogIn
              </Button>
              <Button component={Link} to="/signup" variant="contained" color="secondary" sx={{ marginLeft: '8px' }}>
                SignUp
              </Button>
            </>
          ) : (
            <Button variant="contained" color="secondary">
              LogOut
            </Button>
          )}
        </Box>
      </Box>
    );
  };


export default function HomePage() {
  return (
    <>
      <Navbar isLoggedIn={false} />
      <Box style={{ backgroundColor: '#f4f6f8', height: 'calc(100vh - 64px)', padding: '2rem' }}>
        <Typography variant="h4">Cuidar tu auto es as√≠ de simple</Typography>
        <Box mt={2}>
          <img src="../../public/carvuk.png" alt="Car Service" style={{ width: '100%', borderRadius: 8 }} />
          <Button component={Link} to="/servicios" variant="contained" color="primary" fullWidth>
            Ver servicios
          </Button>
        </Box>
      </Box>
    </>
  );
}
